import React, {Component} from 'react';
import Axios from 'axios';

class Search extends Component{
    constructor(props){
        super(props)
        this.state = {
            city: "",
            suburb: "",
            checkin:"",
            checkout:""
        }
    }






    async getData(){
        const data=this.state
        console.log(data)
        const response=await Axios.get("http://127.0.0.1:8081/v2/room/search",
        {headers: 
            {'content-type':'application/json',
                'accept':'application/xml'
        }
    })
        console.log(response.data)
    }
    handleInputChange = (event) =>{
        event.preventDefault()
        this.setState({
            [event.target.name] : event.target.value
        })
    }
    render(){
        const {city} =this.state
        const {suburb} =this.state
        const {checkin} =this.state
        const {checkout} =this.state

        const querystr="city=sydney&suburb=maroubra&checkin=2020-04-03&checkout=2020-04-07"
        const usp= new URLSearchParams(querystr)

        for (const [key,value] of usp){
            console.log(`${key} =>${value}`)
        }

    return (
        <div className="back">
            <div className="Search">
                <h2>Find your place</h2>
                <br/>
                <form>
                    <label className="ci"><b>City:</b>
                        <input type="text" name="city" value={city} placeholder="input city name"
                        onChange={this.handleInputChange}/>
                    </label>
                    <br/>
                    <label className="ci"><b>Suburb:</b>
                        <input type="text" name="suburb" value={suburb} placeholder="input suburb name"
                        onChange={this.handleInputChange}/>  
                    </label>
                    <br/>
                    <label className="ci"><b>Check in:</b>
                    <input type="date" name="checkin" value={checkin} placeholder="input check in date"
                    onChange={this.handleInputChange}/>
                    </label>
                    <br/>
                    <label className="ci"><b>Check out:</b>
                        <input type="date" name="checkout" value={checkout} placeholder="input check out date"
                        onChange={this.handleInputChange}/>
                    </label>
                    <br/>
                    <button className="sea_button" >
                        <h3>search</h3>
                    </button>
                </form>        
            </div>
        </div>
    );
    }
}
export default Search;
